insert  into `companies_profiles`(`id`,`name`,`company_moto`,`description`,`company_description_title`,`address`,`contact`,`email`,`company_image_title`,`photo_url`,`user_id`,`created_at`) values (1,'Simple Prabidhi','Why Over-complicate ?','<p><strong>Simple Prabidhi&nbsp;</strong>is&nbsp;small but growing and&nbsp;ambitious web development and mobile application development company. We provide quality sofware solutions for your business problem. We are a self displined team that is dedicated to meeting the deadline.&nbsp;&nbsp;</p>\r\n\r\n<p>Our team handles every project with personal care. Our designs not only reflect your business objectives but also help drive your business.</p>\r\n\r\n<p>We provide you sofware products that are highly suited to your custom needs.</p>','Company  Descriptions','Thapathali','9808417239','a@a.com','Images Gallery','http://www.dnasbookdigimarket.com/uploads/back_photo/20180718_170752_20180718_121006_office.jpg',1,NULL);
insert  into `companies_profiles`(`id`,`name`,`company_moto`,`description`,`company_description_title`,`address`,`contact`,`email`,`company_image_title`,`photo_url`,`user_id`,`created_at`) values (3,'DNAsbook','Results Are Guaranteed!','<p>At Opportunity &quot;4&quot;, we know that everybody or almost everybody needs financial help to realize his dreams, this means everybody has dreams, desires or whatever you call it but most of time, it is money that blocks all this! Listen, we have help here for you to meet your financial needs, whether you believe it or not, it is true what you are reading! In fact, we don&#39;t need your believe to help you with your financial needs! Just take the actions we are going to ask you and leave the rest to us! We are not going to ask you money, only actions, we are giving you money, not you giving us money! Is it clear? Now let&#39;s go!</p>','DNAsbook General','160 Grumman Ave, Apt 207 Newark NJ 07112','908 249 7637','yahiadjipe@yahoo.com','DNAsbook General','http://www.dnasbookdigimarket.com/uploads/back_photo/20180723_153457_wanderurlaub-grossarl-wanderhotel-alte-post-5-1900x700.jpg',2,NULL);
