insert  into `faqs`(`id`,`question`,`slug`,`answer`,`created_at`,`updated_at`,`lang`) values (1,'1) What is Opportunity \"4\"?','1-what-is-opportunity-4','<p>&nbsp;</p>\r\n\r\n<p>1) What is Opportunity &quot;4&quot;?</p>\r\n\r\n<p>Opportunity &quot;4&quot; is a software put together to help common people, everyday people who are trying to make the two ends meet, who are trying to put food on the table of the family ...... to get helped and in turn help other people to find this opportunity and free them financially! Selfish people cannot succeed in Opportunity &quot;4&quot;! The more you share Opportunity &quot;4&quot;, the more users subscribe under you, the more benefits you get!</p>','2017-10-16 20:04:30','2018-07-04 09:20:00','en');
insert  into `faqs`(`id`,`question`,`slug`,`answer`,`created_at`,`updated_at`,`lang`) values (4,'3) How Opportunity \"4\" pays your monthly fees?','3-how-opportunity-4-pays-your-monthly-fees','<p>&nbsp;</p>\r\n\r\n<p>3) How Opportunity &quot;4&quot; pays your monthly fees?</p>\r\n\r\n<p>Opportunity &quot;4&quot; pays your monthly fees from the time you have 10 subcribers in your team, no matter what level!&nbsp;(from level 1 to level 4). Why? Because for&nbsp;10 subscribers in your team, the system returns to you as benefit every month the amount of the monthly fee. You will begin making money in the system from the 11th subscriber in your group. The golden beginning in Opportunity &quot;4&quot; is to bring 20 subscribers in the system in your very 1st month, in the month you enter the system. Why? Please, see next question!</p>','2018-07-05 09:17:21','2018-09-12 04:12:48','en');
insert  into `faqs`(`id`,`question`,`slug`,`answer`,`created_at`,`updated_at`,`lang`) values (6,'4) How to NEVER pay fees in Opportunity \"4\"?','4-how-to-never-pay-fees-in-opportunity-4','<p>&nbsp;</p>\r\n\r\n<p>4) How to NEVER pay fees in Opportunity &quot;4&quot;?</p>\r\n\r\n<p>To never pay fees in Opportunity &quot;4&quot;, you HAVE to bring 20 active subscribers into the system before the end of the month you enter Opportunity &quot;4&quot;! These 20 active subcribers might not be brought into the system by you only, as long as you have 20 active subcribers in your group, no matter what level they locate (from level 1 to 4), you are fine!&nbsp;Why? The percentage of the fees of the 20 active subscribers in your group will amount 2 times the monthly fees. Then at the end of the month,&nbsp;the system reimburses the fees you paid to enter the Opportunity &quot;4&quot; and you have another monthly fee for the next month fees payment. As you can see, it is like you never pay fees in the system because you are reimbursed the one you paid to enter the system and are given another monthly fee for the next month!</p>','2018-07-05 09:46:20','2018-09-12 04:12:10','en');
insert  into `faqs`(`id`,`question`,`slug`,`answer`,`created_at`,`updated_at`,`lang`) values (2,'2) Why Opportunity \"4\"?','2-why-opportunity-4','<p>&nbsp;</p>\r\n\r\n<p>2) Why Opportunity &quot;4&quot;?</p>\r\n\r\n<p>Opportunity &quot;4&quot; is primarily created to help poor continents, specially Africa. We do believe at Opportunity &quot;4&quot; that all over the world, in both poor and rich countries, people have &quot;dreams&quot; and talents but these get put on hold or lost because of financial means. We believe that poor people from the poor areas of the world are, in no way, lesser than people from rich areas, what makes the difference is opportunities, the advantage people in rich areas have on people in poor areas of the world is rich areas have more opportunities than poor areas. To be born in a poor area&nbsp;is not a choice, it is a pure hazard, it is not even a God decision like some people might believe it, you find it out at birth! The same way you don&#39;t choose your parents and country, the same way you are not in control of your place of birth, you cannot even change it at your birth, you might leave it if you choose to but you cannot change.&nbsp;</p>\r\n\r\n<p>Opportunity &quot;4&quot; was created to give to poor areas of the world an opportunity their birth area might not give to them: easy financial means. We believe this will allow them to pursue their dreams and work on their talents we are so convinced they have.</p>','2018-07-04 09:06:48','2018-10-31 13:06:42','en');
insert  into `faqs`(`id`,`question`,`slug`,`answer`,`created_at`,`updated_at`,`lang`) values (7,'5) What is an active subscriber?','5-what-is-an-active-subscriber','<p>&nbsp;</p>\r\n\r\n<p>5) What is an active subscriber?</p>\r\n\r\n<p>An active subcriber is the subscriber who pays the monthly fees on time. You are only paid your benefits at the end of the month if you are active.</p>','2018-07-05 09:50:11','2018-09-12 04:11:52','en');
insert  into `faqs`(`id`,`question`,`slug`,`answer`,`created_at`,`updated_at`,`lang`) values (8,'6) Does Opportunity \"4\" involve sale?','6-does-opportunity-4-involve-sale','<p>&nbsp;</p>\r\n\r\n<p>6) Does Opportunity &quot;4&quot; involve sale?</p>\r\n\r\n<p>No! You don&#39;t have to sell anything in Opportunity &quot;4&quot;. The only thing you need to do is to share this opportunity, the more you share it, the bigger your benefits become!</p>','2018-07-05 23:30:36','2018-09-12 04:10:12','en');
insert  into `faqs`(`id`,`question`,`slug`,`answer`,`created_at`,`updated_at`,`lang`) values (9,'7) What is multiple accounts in Opportunity \"4\"?','7-what-is-multiple-accounts-in-opportunity-4','<p>&nbsp;</p>\r\n\r\n<p>7) What is multiple accounts in Opportunity &quot;4&quot;?</p>\r\n\r\n<p>Opportunity &quot;4&quot; allows you to have as many as accounts you want. As long as you pay the fees of your accounts, you benefit from all of them. Why multiple accounts? Please, read the next question!</p>','2018-07-05 23:50:58','2018-09-12 04:10:47','en');
insert  into `faqs`(`id`,`question`,`slug`,`answer`,`created_at`,`updated_at`,`lang`) values (10,'8) Why having multiple accounts in Opportunity \"4\"?','8-why-having-multiple-accounts-in-opportunity-4','<p>&nbsp;</p>\r\n\r\n<p>8) Why having multiple accounts in Opportunity &quot;4&quot;?</p>\r\n\r\n<p>We have challenges in Opportunity &quot;4&quot;. An account can only benefit from the challenges once, but if you have multiple accounts, you can benefit from the same challenge as many times as the number of your accounts when&nbsp;your accounts qualify.</p>','2018-07-06 00:07:23','2018-09-12 04:09:30','en');
insert  into `faqs`(`id`,`question`,`slug`,`answer`,`created_at`,`updated_at`,`lang`) values (11,'9) What are the challenges that we have in Opportunity \"4\"?','9-what-are-the-challenges-that-we-have-in-opportunity-4','<p>&nbsp;</p>\r\n\r\n<p>9) What are the challenges that we have in Opportunity &quot;4&quot;?</p>\r\n\r\n<p>These are the challenges we have in Opportunity &quot;4&quot;? Please <a href=\"https://www.dnasbookdigimarket.com/pages/the-3-opportunity-4-challenges-and-their-rewards\">click here</a>!</p>\r\n\r\n<p>For an explanation in a video, please&nbsp;<a href=\"https://www.dnasbookdigimarket.com/user-academy/view/48\">click here</a>!</p>','2018-07-06 05:12:17','2018-09-12 04:11:29','en');
insert  into `faqs`(`id`,`question`,`slug`,`answer`,`created_at`,`updated_at`,`lang`) values (20,'1) Qu\'est-ce que l\'Opportunité \"4\"?','1-qu-est-ce-que-l-opportunit-4','<p><a name=\"1) Qu\'est-ce que l\'Opportunité \"></a></p>\r\n\r\n<div><a name=\"1) Qu\'est-ce que l\'Opportunité \">1) Qu&#39;est-ce que l&#39;Opportunit&eacute; &quot;4&quot;?</a></div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div><a name=\"1) Qu\'est-ce que l\'Opportunité \"> </a></div>\r\n\r\n<div><a name=\"1) Qu\'est-ce que l\'Opportunité \">Opportunity &quot;4&quot; est un logiciel con&ccedil;u pour aider les gens ordinaires, les gens ordinaires qui essaient de joindre les deux bouts chaque jour, qui essaient de mettre de la nourriture sur la table de la famille ...... pour &ecirc;tre aid&eacute; et &agrave; tour aider les autres &agrave; trouver cette Opportunit&eacute; et les lib&eacute;rer financi&egrave;rement! Les personnes &eacute;go&iuml;stes ne peuvent pas r&eacute;ussir dans Opportunity &quot;4&quot;! Plus vous partagez l&#39;opportunit&eacute; &quot;4&quot;, plus nombreux sont les utilisateurs qui s&#39;abonnent sous vous, plus vous y b&eacute;n&eacute;ficiez d&#39;avantage!</a></div>',NULL,NULL,'fr');
insert  into `faqs`(`id`,`question`,`slug`,`answer`,`created_at`,`updated_at`,`lang`) values (21,'2) Pourquoi l\'Opportunité \"4\"?','2-pourquoi-l-opportunit-4','<p>&nbsp;</p>\r\n\r\n<div><a name=\"2) Pourquoi l\'Opportunité \">2) Pourquoi l&#39;Opportunit&eacute; &quot;4&quot;?</a></div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div><a name=\"2) Pourquoi l\'Opportunité \"> </a></div>\r\n\r\n<div><a name=\"2) Pourquoi l\'Opportunité \">L&#39;Opportunit&eacute; &quot;4&quot; est principalement cr&eacute;&eacute;e pour aider les continents pauvres, en particulier l&rsquo;Afrique. Nous pensons, &agrave; l&#39;Opportunit&eacute; &quot;4&quot;, que partout dans le monde, dans les pays riches comme dans les pays pauvres, les gens ont des &quot;r&ecirc;ves&quot; et des talents, mais ceux-ci sont laiss&eacute;s non r&eacute;alis&eacute;s ou perdus par manque de moyens financiers. Nous pensons que les pauvres des r&eacute;gions pauvres du monde ne sont en aucun cas inf&eacute;rieurs &agrave; ceux des r&eacute;gions riches. Ce qui fait la diff&eacute;rence, ce sont les opportunit&eacute;s qui s&#39;offrent &agrave; eux. L&#39;avantage que les habitants des r&eacute;gions riches ont sur les habitants des r&eacute;gions pauvres du monde est ce qu&#39;ils ont plus d&#39;opportunit&eacute;s que les zones pauvres. Na&icirc;tre dans une r&eacute;gion pauvre n&#39;est pas un choix, c&#39;est un pur hazard, ce n&#39;est m&ecirc;me pas une volont&eacute; divine, comme certaines personnes pourraient le croire, vous le d&eacute;couvrez &agrave; la naissance! De la m&ecirc;me mani&egrave;re que vous ne choisissez pas vos parents et votre pays, de la m&ecirc;me mani&egrave;re vous ne contr&ocirc;lez pas votre lieu de naissance, vous ne pouvez m&ecirc;me pas le changer &agrave; votre naissance, vous pouvez le laisser si vous le souhaitez mais vous ne pouvez pas le changer.....</a></div>\r\n\r\n<div><a name=\"2) Pourquoi l\'Opportunité \"> </a></div>\r\n\r\n<div><a name=\"2) Pourquoi l\'Opportunité \">L&#39;Opportunit&eacute; &quot;4&quot; a &eacute;t&eacute; cr&eacute;&eacute;e pour donner aux r&eacute;gions pauvres du monde une opportunit&eacute; que leur r&eacute;gion de naissance ne leur offrirait peut-&ecirc;tre pas: des moyens financiers faciles. Nous pensons que cela leur permettra de poursuivre leurs r&ecirc;ves et de mettre &agrave; profit leurs talents que nous sommes tellement convaincus qu&#39;ils ont!.</a></div>\r\n\r\n<ul style=\"list-style-type:none\">\r\n	<li><a name=\"1) Qu\'est-ce que l\'Opportunité \"></a>\r\n\r\n	<div><a name=\"1) Qu\'est-ce que l\'Opportunité \"> </a></div>\r\n	</li>\r\n</ul>',NULL,NULL,'fr');
insert  into `faqs`(`id`,`question`,`slug`,`answer`,`created_at`,`updated_at`,`lang`) values (22,'3) Commentaire Opportunité \"4\" règle vos frais mensuels?','3-commentaire-opportunit-4-r-gle-vos-frais-mensuels','<p>&nbsp;</p>\r\n\r\n<div><a name=\"3) Commentaire l\'Opportunité \">3) Commentaire Opportunit&eacute; &quot;4&quot; r&egrave;gle vos frais mensuels?</a></div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div><a name=\"3) Commentaire l\'Opportunité \"> </a></div>\r\n\r\n<div><a name=\"3) Commentaire l\'Opportunité \">L&#39;Opportunit&eacute; &quot;4&quot; paie vos frais mensuels &agrave; partir de l&#39;instant o&ugrave; vous avez 10 abonn&eacute;s dans votre &eacute;quipe, quel soit leur niveau! (du niveau 1 au niveau 4). Pourquoi? Parce que pour 10 membres de votre &eacute;quipe, le syst&egrave;me vous paie chaque mois le montant des frais mensuels. Vous commencez &agrave; gagner de l&#39;argent dans le syst&egrave;me &agrave; partir du 11eme abonn&eacute; dans votre groupe. Un bon d&eacute;but dans l&#39;Opportunit&eacute; &quot;4&quot; consiste &agrave; amener 20 abonn&eacute;s dans le syst&egrave;me d&egrave;s le premier mois, le mois o&ugrave; vous entrez dans le syst&egrave;me. Pourquoi? S&#39;il vous pla&icirc;t, voir la question 4!</a></div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<ul style=\"list-style-type:none\">\r\n	<li><a name=\"4) Comment ne JAMAIS payer de frais dans l\'Opportunité \"></a>\r\n\r\n	<div><a name=\"4) Comment ne JAMAIS payer de frais dans l\'Opportunité \"> </a></div>\r\n	</li>\r\n</ul>',NULL,NULL,'fr');
insert  into `faqs`(`id`,`question`,`slug`,`answer`,`created_at`,`updated_at`,`lang`) values (23,'4) Comment ne JAMAIS payer de frais dans l\'opportunité \"4\"?','4-comment-ne-jamais-payer-de-frais-dans-l-opportunit-4','<p><a name=\"4) Comment ne JAMAIS payer de frais dans l\'Opportunité \"></a></p>\r\n\r\n<div><a name=\"4) Comment ne JAMAIS payer de frais dans l\'Opportunité \">4) Comment ne JAMAIS payer de frais dans l&#39;opportunit&eacute; &quot;4&quot;?</a></div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div><a name=\"4) Comment ne JAMAIS payer de frais dans l\'Opportunité \"> </a></div>\r\n\r\n<div><a name=\"4) Comment ne JAMAIS payer de frais dans l\'Opportunité \">Pour ne jamais payer de frais dans l&#39;Opportunit&eacute; &quot;4&quot;, vous devez amener 20 abonn&eacute;s actifs dans le syst&egrave;me avant la fin du mois durant lequel vous entrez dans l&#39;Opportunit&eacute; &quot;4&quot;! Ces 20 abonn&eacute;s actifs peuvent ne pas &ecirc;tre introduits dans le syst&egrave;me par vous m&ecirc;me, tant que vous avez 20 abonn&eacute;s actifs dans votre groupe, quel que soit le niveau ils se trouvent (du niveau 1 au niveau 4), vous &ecirc;tes bien! Pourquoi? Le pourcentage des frais des 20 abonn&eacute;s actifs de votre groupe sera &eacute;gal &agrave; 2 fois les frais mensuels. Ainsi, &agrave; la fin du mois, le syst&egrave;me rembourse les frais que vous avez pay&eacute;s pour entrer dans l&#39;Opportunit&eacute; &quot;4&quot; et vous disposez d&#39;un autre frais mensuel pour le paiement des frais du mois suivant. Comme vous pouvez le constater, c&#39;est comme si vous n&#39;aviez jamais pay&eacute; de frais dans le syst&egrave;me, car nous vous remboursons les frais que vous avez pay&eacute; pour entrer dans le syst&egrave;me et vous recevez un autre frais mensuel pour le mois suivant!</a></div>\r\n\r\n<div>&nbsp;</div>',NULL,NULL,'fr');
insert  into `faqs`(`id`,`question`,`slug`,`answer`,`created_at`,`updated_at`,`lang`) values (24,'5) Qu\'est-ce qu\'un abonné actif?','5-qu-est-ce-qu-un-abonn-actif','<p><a name=\"5) Qu\'est-ce qu\'un abonné actif?\"></a>5) Qu&#39;est-ce qu&#39;un abonn&eacute; actif?</p>\r\n\r\n<p style=\"margin-left:0px; margin-right:0px\"><a name=\"5) Qu\'est-ce qu\'un abonné actif?\">Un abonn&eacute; actif est l&rsquo;abonn&eacute; qui paie les frais mensuels &agrave; temps &agrave; la fin du mois. Vos commissions ne vous sont vers&eacute;es &agrave; la fin du mois que si vous &ecirc;tes actif.</a></p>\r\n\r\n<p style=\"margin-left:0px; margin-right:0px\">&nbsp;</p>',NULL,NULL,'fr');
insert  into `faqs`(`id`,`question`,`slug`,`answer`,`created_at`,`updated_at`,`lang`) values (25,'6) Vend-on quelque chose dans l’Opportunité \"4\"?','6-vend-on-quelque-chose-dans-l-opportunit-4','<p><a name=\"6) Vend-on quelque chose dans l’Opportunité \"></a></p>\r\n\r\n<div><a name=\"6) Vend-on quelque chose dans l’Opportunité \">6) Vend-on quelque chose dans l&rsquo;Opportunit&eacute; &quot;4&quot;?</a></div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div><a name=\"6) Vend-on quelque chose dans l’Opportunité \"> </a></div>\r\n\r\n<div><a name=\"6) Vend-on quelque chose dans l’Opportunité \">Non! Vous n&#39;avez rien &agrave; vendre dans l&#39;Opportunit&eacute; &quot;4&quot;. La seule chose que vous devez faire est de partager cette opportunit&eacute;, plus vous la partagez, plus vos commissions deviennent importantes!</a></div>\r\n\r\n<div>&nbsp;</div>',NULL,NULL,'fr');
insert  into `faqs`(`id`,`question`,`slug`,`answer`,`created_at`,`updated_at`,`lang`) values (26,'7) C\'est quoi la pluralité de comptes dans l\'Opportunité \"4\"?','7-c-est-quoi-la-pluralit-de-comptes-dans-l-opportunit-4','<p>&nbsp;</p>\r\n\r\n<p><a name=\"7) C\'est quoi la pluralité de comptes dans l\'Opportunité \"></a>7) C&#39;est quoi la pluralit&eacute; de comptes dans l&#39;Opportunit&eacute; &quot;4&quot;?</p>\r\n\r\n<p><a name=\"7) C\'est quoi la pluralité de comptes dans l\'Opportunité \">L&#39;Opportunit&eacute; &quot;4&quot; vous permet d&#39;avoir autant de comptes que vous voulez. Tant que vous payez les frais de vos comptes, vous b&eacute;n&eacute;ficiez de tous ces comptes. Pourquoi plusieurs comptes? S&#39;il vous pla&icirc;t, lisez la question 8!</a></p>\r\n\r\n<ul style=\"list-style-type:none\">\r\n	<li><a name=\"8) Pourquoi avoir plusieurs comptes dans l\'Opportunité \"></a>\r\n\r\n	<div><a name=\"8) Pourquoi avoir plusieurs comptes dans l\'Opportunité \"> </a></div>\r\n	</li>\r\n</ul>',NULL,NULL,'fr');
insert  into `faqs`(`id`,`question`,`slug`,`answer`,`created_at`,`updated_at`,`lang`) values (27,'8) Pourquoi avoir plusieurs comptes dans l\'Opportunité \"4\"?','8-pourquoi-avoir-plusieurs-comptes-dans-l-opportunit-4','<p>&nbsp;</p>\r\n\r\n<p><a name=\"8) Pourquoi avoir plusieurs comptes dans l\'Opportunité \"></a>8) Pourquoi avoir plusieurs comptes dans l&#39;Opportunit&eacute; &quot;4&quot;?</p>\r\n\r\n<div><a name=\"8) Pourquoi avoir plusieurs comptes dans l\'Opportunité \">Nous avons des d&eacute;fis dans l&#39;Opportunit&eacute; &quot;4&quot;. Un compte ne peut b&eacute;n&eacute;ficier des d&eacute;fis qu&#39;une seule fois, mais si vous avez plusieurs comptes, vous pouvez b&eacute;n&eacute;ficier du m&ecirc;me d&eacute;fi autant de fois de comptes que vous avez lorsque vos comptes sont qualifi&eacute;s.</a></div>\r\n\r\n<div>&nbsp;</div>',NULL,NULL,'fr');
insert  into `faqs`(`id`,`question`,`slug`,`answer`,`created_at`,`updated_at`,`lang`) values (28,'9) Quels sont les défis que nous avons dans Opportunity \"4\"?','9-quels-sont-les-d-fis-que-nous-avons-dans-opportunity-4','<p>&nbsp;</p>\r\n\r\n<p>9) Quels sont les d&eacute;fis que nous avons dans Opportunity &quot;4&quot;?</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Ce sont les d&eacute;fis que nous avons dans l&#39;opportunit&eacute; &quot;4&quot;? <a href=\"https://www.dnasbookdigimarket.com/pages/les-3-defis-dans-opportunity-4\">Cliquez ici s&#39;il vous plait!</a></p>\r\n\r\n<p>Pour une explication dans une vid&eacute;o, <a href=\"https://www.dnasbookdigimarket.com/user-academy/view/50\">cliquez ici!</a></p>\r\n\r\n<p>&nbsp;</p>',NULL,NULL,'fr');
