insert  into `pages`(`id`,`status`,`parent_id`,`title`,`slug`,`content`,`left_sidebar_block_id`,`right_sidebar_block_id`,`type`,`layout`,`created_at`,`updated_at`,`language`) values (2,'PUBLISHED',NULL,'Page One Edit','page-one-edit','<h1>this is sample content for page One</h1>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"width:100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n			<p><strong><strong>Lisez attentivement les diff&eacute;rents contrats, leurs termes et conditions! Faites votre chois de contrat et remplissez-en sa&nbsp;<strong>pr&eacute;application</strong>&nbsp;en ligne. Attendez une r&eacute;ponse du si&egrave;ge mondial de DNAsbook General, USA, par email (par l&#39;email que vous avez mis sur votre pr&eacute;application), laquelle r&eacute;ponse vous dira si votre application est accept&eacute;e ou pas. Au cas o&uacute; il y a des insuffisances, on vous dira&nbsp;quelles en sont les raisons. Si vous avez besoin de choses suppl&eacute;mentaires pour vous faire qualifier, l&#39;email vous le dira. Si dans 2 semaines (14 jours) vous n&#39;avez pas re&ccedil;u de r&eacute;ponse, contactez-nous (dnasbookcom@dnasbook.com) sans tarder!</strong></strong></p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>',NULL,1,'PAGE','RIGHT SIDEBAR','2017-12-11 18:29:51','2018-06-12 05:54:15','en');
insert  into `pages`(`id`,`status`,`parent_id`,`title`,`slug`,`content`,`left_sidebar_block_id`,`right_sidebar_block_id`,`type`,`layout`,`created_at`,`updated_at`,`language`) values (4,'PUBLISHED',NULL,'Home','home','<div>\r\n<div>\r\n<div style=\"margin-left:0px\">\r\n<div>\r\n<div>\r\n<div>\r\n<div>\r\n<div>\r\n<div><strong>ABOUT US</strong></div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<!-- No Footer -->\r\n\r\n<p><img alt=\"\" src=\"https://static.wixstatic.com/media/ea71bb_e7959a5be116482b9727a9be900d2d35~mv2_d_5454_3840_s_4_2.jpg\" style=\"float:right; height:221px; width:314px\" /></p>\r\n\r\n<p>&nbsp;Why Opportunity &quot;4&quot;?</p>\r\n\r\n<p>Where the idea of Opportunity &quot;4&quot; came from? Thomas, CEO/Founder</p>\r\n\r\n<p>of Opportunity &quot;4&quot;&nbsp;was listening to an&nbsp;African president one</p>\r\n\r\n<p>day&nbsp;in his early teenage years and the president said something that&nbsp;</p>\r\n\r\n<p>changed his&nbsp;life! The president was giving a speech on how Africans</p>\r\n\r\n<p>can help each other, how best&nbsp;they can help someone in need!</p>\r\n\r\n<p>Answering his own question, he gave an example....</p>\r\n\r\n<p>​</p>\r\n\r\n<p>He said the best way to help someone in need of fish to survive is</p>\r\n\r\n<p>&quot;not bringing fishes to the person everyday but is to bring</p>\r\n\r\n<p>the person to the fish&quot;. This means that the best way to help someone</p>\r\n\r\n<p>is to make sure that after the help the person becomes independent,&nbsp;</p>\r\n\r\n<p>can be able to take care of himself and help other people to&nbsp;</p>\r\n\r\n<p>care of themselves too.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>That speech becomes the &quot;father&quot; of Opportunity &quot;4&quot; today. How?</p>',NULL,1,'PAGE','RIGHT SIDEBAR','2017-12-16 04:04:46','2018-06-12 07:55:14','en');
insert  into `pages`(`id`,`status`,`parent_id`,`title`,`slug`,`content`,`left_sidebar_block_id`,`right_sidebar_block_id`,`type`,`layout`,`created_at`,`updated_at`,`language`) values (5,'PUBLISHED',NULL,'About Us','about-us','<p>&nbsp;</p>\r\n\r\n<h1>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; <em><strong>Why&nbsp;DNAsbook Digital Marketing?</strong></em></h1>\r\n\r\n<p>Why opportunity &quot;4&quot;? Where the idea of Opportunity &quot;5&quot; came from? Thomas, CEO/Founder of Opportunity &quot;4&quot; was listening to an African president one day in his early teenage years and the president said something that changed his life! The president was giving a speech on how Africans can help each other, how best they can help someone in need! Answering his own question, he gave an example....</p>\r\n\r\n<p>He said the best way to help someone in need of fish to survive is &quot;not bringing fishes to the person everyday but is to bring the person to the fish&quot;. This means that the best way to help someone is to make sure that after the help the person becomes independent, can be able to take care of himself and help other people to care of themselves too. That speech becomes the &quot;father&quot; of Opportunity &quot;4&quot; today. How?</p>\r\n\r\n<p><a href=\"https://www.youtube.com/watch?v=OLSqdQCzCgo&amp;t=2s\" target=\"_blank\">Watch This Video</a></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>',NULL,NULL,'PAGE','NO SIDEBAR','2018-07-01 06:44:59','2018-07-11 13:31:13','en');
insert  into `pages`(`id`,`status`,`parent_id`,`title`,`slug`,`content`,`left_sidebar_block_id`,`right_sidebar_block_id`,`type`,`layout`,`created_at`,`updated_at`,`language`) values (6,NULL,NULL,'Why Opportunity \"4\"?','why-opportunity-4','<p>Why Opportunity &quot;4&quot;? Where the idea of Opportunity &quot;4&quot; came from? Thomas, CEO/Founder of Opportunity &quot;4&quot; was listening to an African president one day in his early teenage years and the president said something that changed his life! The president was giving a speech on how Africans can help each other, how best they can help someone in need! Answering his own question, he said this:</p>\r\n\r\n<p>The best way to help someone in need of fish to survive is &quot;not bringing fishes to the person everyday but is to bring the person to the fish&quot;. This means that the best way to help someone is to make sure that after the help the person becomes independent, can be able to take care of himself and help other people to care of themselves too. That speech becomes the &quot;father&quot; of Opportunity &quot;4&quot; today.</p>',NULL,NULL,'BLOCK',NULL,'2018-07-05 06:42:10','2018-11-02 01:36:23','fr');
insert  into `pages`(`id`,`status`,`parent_id`,`title`,`slug`,`content`,`left_sidebar_block_id`,`right_sidebar_block_id`,`type`,`layout`,`created_at`,`updated_at`,`language`) values (21,'PUBLISHED',NULL,'The 3 Opportunity 4 challenges and Their Rewards','the-3-opportunity-4-challenges-and-their-rewards','<div>&nbsp;</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>1) Rule 100/30 for 3 months</div>\r\n\r\n<div>4) 90 000 x 30 = 2 700 000; 2 700 000 x $50 = 135 000 000; $135 000 000 x 10% = $13 500 000</div>\r\n\r\n<div>3) 3 000 x 30 = 90 000; $90 000 x $50 = $4 500 000; $4 500 000 x 10% = $450 000</div>\r\n\r\n<div>2) 100 x 30 = 3 000; $3 000 x $50 = $150 000; $150 000 x 10% = $15 000</div>\r\n\r\n<div>1) 100; 100 x $50 = $5 000; $5 000 x 10% = $500</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>Total: $500 + $15 000 + $450 000 + $13 500 000 = $13 965 500</div>\r\n\r\n<div>You must maintain this for 3 months: $13 965 500 x 3 = $41 896 500</div>\r\n\r\n<div>If you earn $14 000 000 or more for 3 months, then you successfully reach the challenge 1!</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>Rewards: $1 000 000 towards the purchase of a luxury car, house, boat etc...</div>\r\n\r\n<div>Want to take the money cash? Please, see conditions!</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>2) Rule 200/60 for 2 months</div>\r\n\r\n<div>4) 720 000 x 60 = 43 200 000; $43 200 000 x $50 = $2 160 000 000; $ 2 160 000 000 x 10% = $216 000 000</div>\r\n\r\n<div>3) 12 000 x 60 = 720 000; 720 000 x $50 = $36 000 000; $36 000 000 x 10% = $3 600 000</div>\r\n\r\n<div>2) 200 x 60 = 12 000; 12 000 x $50 = $600 000; $600 000 x 10% = $60 000</div>\r\n\r\n<div>1) 200; 200 x $50 = $10 000; $10 000 x 10% = $1 000</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>Total: $1 000 + $60 000 + $3 600 000 + $216 000 000 = $219 661 000</div>\r\n\r\n<div>You must maintain this for 2 months: $439 322 000</div>\r\n\r\n<div>If you earn $220 000 000 or more for 2 months, then you successfully reach the challenge 2!</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>Rewards: $2 000 000 towards the purchase of a luxury car, house, boat etc...</div>\r\n\r\n<div>Want to take the money cash? Please, see conditions!</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>3) Rule 300/90 for just one month</div>\r\n\r\n<div>4) 2 430 000 x 90 = 218 700 000; 218 700 000 x $50 = $10 935 000 000; $10 935 000 000 x 10% = $1 093 500 000</div>\r\n\r\n<div>3) 27 000 x 90 = 2 430 000; 2 430 000 x $50 = $121 500 000; $121 500 000 x 10% = $12 150 000</div>\r\n\r\n<div>2) 300 x 90 = 27 000; 27 000 x $50 = $1 350 000; $1 350 000 x 10% = $135 000</div>\r\n\r\n<div>1) 300; 300 x $50 = $15 000; $15 000 x 10% = $1 500</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>Total: $ 1 500 + $135 000 + $12 150 000 + $1 093 500 000 = $1 105 786 500</div>\r\n\r\n<div>Just for one month!</div>\r\n\r\n<div>If you earn $1 200 000 000 or more for just one month, then you successfully reach the challenge 3!</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>Reward: $3 000 000 towards the purchase of a luxury car, house, boat et...</div>\r\n\r\n<div>Want to take the money cash? Please, see conditions!</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>There are termes and conditions governing these challenges.</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>For an explanation in a video, please <a href=\"https://www.dnasbookdigimarket.com/user-academy/view/48\">click here</a>!</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>&nbsp;</div>',NULL,NULL,'PAGE','NO SIDEBAR','2018-11-15 02:53:42','2018-11-15 03:01:17','en');
