insert  into `pages`(`id`,`status`,`parent_id`,`title`,`slug`,`content`,`left_sidebar_block_id`,`right_sidebar_block_id`,`type`,`layout`,`created_at`,`updated_at`,`language`) values (9,'PUBLISHED',5,'Why Opportunity  4 was created','why-opportunity-4-was-created','<h1>&nbsp;</h1>\r\n\r\n<p>Why Opportunity &quot;4&quot;? Where the idea of Opportunity &quot;4&quot; came from? I&nbsp;was listening to an African president one day in his early teenage years and the president said something that changed his life! The president was giving a speech on how Africans can help each other, how best they can help someone in need! Answering his own question, he gave an example....</p>\r\n\r\n<p>He said the best way to help someone in need of fish to survive is &quot;not bringing fishes to the person everyday but is to bring the person to the fish&quot;. How can you bring someone to the fish? You bring someone to the fish if you bring the person to&nbsp;the river, to the see or to wherever you fish and teach&nbsp;the person how to fish himself, that is the&nbsp;best way to help someone. If you help someone this way, after the help, the person becomes independent, can be able to take care of himself and help other people to care of themselves too. That speech becomes the &quot;father&quot; of Opportunity &quot;4&quot; today. How?</p>\r\n\r\n<p>In my tennage years, acquiring good education was the goal with the believe that good education automatically gives good job, future etc... Unfortunately, we quickly realized that it was not the case! People went to school but could not find job. Why? The government was and is still today the principal source of jobs with better benefits. The private sector was not and is still not today developed. People was discouraged and left school. Results: Poverty!&nbsp;</p>\r\n\r\n<p>I began thinking of a possible solution..... And I happened to come to USA. When looking for possible reasons why USA is so economically powerful, I noticed the private sector specially the entrepreneurship. This particularly retains my attention because if we can develop the private sector in Africa through entrepreneurship, our financial problems might find serious solutions if not resolved. It is&nbsp;thinking about this that I came up with Opportunity &quot;4&quot;. It is American entrepeneurship &quot;africanized&quot; to the point that I even eliminate for users the monthly fee&nbsp;payments (they are generated by the system for the users). All this is possible by using a famous rule I invented: Rule 20/20.</p>\r\n\r\n<p>With rule 20/20 applied to Opportunity &quot;4&quot;, you can be able to generate $842 100 at the end of your 4th month entering the system. If you follow rule 20/20 as explained, the $842 100 are guaranteed at the end of the 4th month! <a href=\"http://www.dnasbookdigimarket.com/user-academy/view/15\">Watch this video to see how!</a></p>\r\n\r\n<p>&nbsp;</p>',NULL,NULL,'PAGE','NO SIDEBAR','2018-07-11 18:12:10','2018-11-15 01:49:18','en');
