\n<div>\r\n<ol>\r\n	<li>&nbsp;</li>\r\n</ol>\r\n</div>\r\n</div>\r\n</div>\r\n\r\n<div>Jan 30, 2018 - However, to my surprise, during the evening&#39;s chitchat it emerged that the two friends habitually exchanged emails using Google <strong>Translate</strong>.</div>\r\n\r\n<div>&nbsp;</div>\r\n</div>\r\n</div>\r\n</div>\r\n\r\n<div>\r\n<div>\r\n<div>\r\n<div>\r\n<h3><a href=\"https://www.deepl.com/en/translator\" style=\"color:#660099; cursor:pointer; text-decoration-line:none\">DeepL Translator</a></h3>\r\n&nbsp;\r\n\r\n<div><a href=\"https://www.deepl.com/en/translator\" style=\"color:#660099; cursor:pointer; text-decoration-line:none\"><cite>https://www.deepl.com/en/translator</cite></a></div>\r\n\r\n<div style=\"margin-left:3px; margin-right:3px\">\r\n<div>\r\n<ol>\r\n	<li>&nbsp;</li>\r\n</ol>\r\n</div>\r\n</div>\r\n</div>\r\n\r\n<div>Use the free DeepL Translator to <strong>translate</strong> your texts with the best machine <strong>translation</strong> available, powered by DeepL&#39;s world-leading neural network technology.</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>',NULL,NULL,'PAGE','NO SIDEBAR','2018-11-15 00:53:24','2018-11-15 00:53:24','en');
